export function debounce(fn, wait, immediate) {
  let timeout;
  return function (...args) {
    if (timeout) clearTimeout(timeout);
    if (immediate) {
      const callNow = !timeout;
      timeout = setTimeout(() => {
        timeout = null;
      }, wait);
      if (callNow) fn.apply(this, args);
    } else {
      timeout = setTimeout(() => {
        console.log(111);
        fn.apply(this, args);
      }, wait);
    }
  };
}

ctx.test1 = debounce(ctx.test1, 1000, false);

for (let i = 0; i < 3; i++) {
  ctx.test1();
}

